import React from 'react';
import { motion } from 'framer-motion';
import { 
  MapPin, 
  Clock, 
  Users, 
  Camera, 
  Utensils, 
  Gift, 
  Shield, 
  Zap,
  Heart,
  Globe
} from 'lucide-react';

const Features: React.FC = () => {
  const features = [
    {
      icon: MapPin,
      title: "Smart Navigation",
      description: "AI-powered park navigation with real-time wait times and optimal routing",
      color: "from-blue-500 to-cyan-500"
    },
    {
      icon: Clock,
      title: "Perfect Timing",
      description: "Get the best times to visit attractions and avoid crowds",
      color: "from-purple-500 to-pink-500"
    },
    {
      icon: Users,
      title: "Group Planning",
      description: "Coordinate with family and friends for seamless group experiences",
      color: "from-green-500 to-emerald-500"
    },
    {
      icon: Camera,
      title: "Photo Opportunities",
      description: "Discover the best photo spots and character meet-and-greets",
      color: "from-yellow-500 to-orange-500"
    },
    {
      icon: Utensils,
      title: "Dining Reservations",
      description: "Secure reservations at the most sought-after restaurants",
      color: "from-red-500 to-rose-500"
    },
    {
      icon: Gift,
      title: "Exclusive Access",
      description: "VIP experiences and behind-the-scenes tours",
      color: "from-indigo-500 to-purple-500"
    },
    {
      icon: Shield,
      title: "Safety First",
      description: "Real-time safety updates and emergency assistance",
      color: "from-teal-500 to-cyan-500"
    },
    {
      icon: Zap,
      title: "Lightning Fast",
      description: "Instant responses and real-time park updates",
      color: "from-amber-500 to-yellow-500"
    },
    {
      icon: Heart,
      title: "Memories Made",
      description: "Create lasting memories with personalized experiences",
      color: "from-pink-500 to-rose-500"
    },
    {
      icon: Globe,
      title: "All Parks",
      description: "Support for all Disney parks worldwide",
      color: "from-emerald-500 to-teal-500"
    }
  ];

  return (
    <section className="py-20 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        {/* Section header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="luxury-text text-4xl md:text-5xl font-bold bg-gradient-enchanted bg-clip-text text-transparent mb-6">
            Enchanted Features
          </h2>
          <p className="text-xl text-gray-400 max-w-3xl mx-auto">
            Discover all the ways our enchanted guide can make your extraordinary adventure truly magical
          </p>
        </motion.div>

        {/* Features grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-5 gap-6">
          {features.map((feature, index) => {
            const Icon = feature.icon;
            return (
              <motion.div
                key={index}
                className="group relative"
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                viewport={{ once: true }}
                whileHover={{ y: -5 }}
              >
                <div className="glass-effect p-6 rounded-xl border border-white/10 hover:border-luxury-gold/30 transition-all duration-300 h-full group-hover:shadow-2xl group-hover:shadow-luxury-gold/20">
                  {/* Gradient background on hover */}
                  <div className={`absolute inset-0 bg-gradient-to-br ${feature.color} opacity-0 group-hover:opacity-10 rounded-xl transition-opacity duration-300`}></div>

                  <div className="relative z-10">
                    {/* Icon */}
                    <div className={`flex items-center justify-center w-16 h-16 mx-auto mb-4 bg-gradient-to-br ${feature.color} rounded-full group-hover:scale-110 transition-transform duration-300`}>
                      <Icon className="w-8 h-8 text-white" />
                    </div>

                    {/* Content */}
                    <h3 className="luxury-text text-lg font-semibold text-white mb-2 text-center">
                      {feature.title}
                    </h3>
                    <p className="text-gray-400 text-sm text-center leading-relaxed">
                      {feature.description}
                    </p>
                  </div>

                  {/* Sparkle effect */}
                  <div className="absolute top-2 right-2 opacity-0 group-hover:opacity-100 transition-opacity duration-300">
                    <div className="w-2 h-2 bg-luxury-gold rounded-full animate-pulse"></div>
                  </div>
                </div>
              </motion.div>
            );
          })}
        </div>

        {/* Bottom CTA */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
          className="text-center mt-16"
        >
          <div className="glass-effect p-8 rounded-2xl border border-luxury-gold/30 max-w-2xl mx-auto">
            <h3 className="luxury-text text-2xl font-bold text-white mb-4">
              Ready for Your Magical Journey?
            </h3>
            <p className="text-gray-300 mb-6">
              Join thousands of families who have experienced the magic of Disney with our AI concierge
            </p>
            <motion.button
              className="px-8 py-3 bg-gradient-luxury text-white font-semibold rounded-lg shadow-lg hover:shadow-xl transition-all duration-300"
              whileHover={{ scale: 1.05, y: -2 }}
              whileTap={{ scale: 0.95 }}
            >
              Start Your Adventure
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Features;
